import React from 'react';
import Header from './Component/Header';
import Body from './Component/Body/Body'
import Footer from './Component/Footer/Footer'
import GotoTop from './Component/GotoTop/GotoTop'

function App() {
  return (
    <div className="App">
      <Header />
      <Body />
      <Footer />
      <GotoTop />
    </div>
  );
}

export default App;
